import "./home.css";
import Social from './Social';
import Data from ''

const Home = () => {
  return (
    <section className="home section" id="home">
      <div className="home__container container grid">
        <div className="home__container grid">
          <Social />
          <div className="home__img"></div>
        </div>
      </div>
    </section>
  )
}

export default Home
